import{app} from 'firebase';
import { getDatabase, ref, set } from 'firebase/database';




const  db = getDatabase(app)

const putData = () =>{
  set(ref(db, 'users/Olwin'), {
    id:1,
    name:"Olwin",
    age:"22",
  });
}

const App = () => {
  return (
    <div>
      App
      <button onClick={putData}>Putdata</button>
    </div>
  )
}

export default App
